import '/Home.css'
export default function Home(props) {
    return (
        <>
            <div className="backround-image" >
                <h3 className="container" style={{ margenLeft: "10rem", marginTop: "6rem", fontFamily: props.font }}>
                    Hi! this is <b style={{ color: props.themeColor }}>Khursheed Ahmed</b><br></br>
                    Welcome to my <b style={{ color: props.themeColor }}>port-folio </b>site</h3>
                {/* <img src="ProfilePic.png" alt="..." style={{ maxHeight: "30rem", width: "17rem", marginLeft: "40rem" }}></img> */}
            </div>
        </>
    );
}
